import Header from "../components/Header";
import { Box, Typography, styled, TextField, Button } from "@mui/material";
import DropDown from "../components/dropdown";
const Component = styled(Box)({
    padding: '80px 200px',
    background: '#F5F5F5'
})
const Container = styled(Box)({
    display: 'flex',
    background: '#ffffff',
    borderRadius:'20',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '0 70px',
    '&>p':{
        fontSize: 35,
        fontWeight: 700,
        opacity: '0.7'
    }
})
const Wrapper = styled(Box)({
    display:'flex',
    flexDirection: 'column'
})
const CreatePost = () => {
    const image = "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTH3zkKYlIHjjoQrE4e-a5xiJIaK0reWlcDhewsx8rjV87d8M82";
    return(
        
        <>
        <Header />
        <Component>
            <Container>
                <Typography>Create a job Post</Typography>
                <img src={image}/>
                
            </Container>
            <Wrapper>
                <TextField placeholder="Job Title"></TextField>
                <DropDown/>
                <TextField placeholder="Job Description"></TextField>
                <DropDown/>
                <DropDown/>
                <DropDown/>
                <Button>Create Job</Button>
            </Wrapper>
        </Component>
        </>
    );
}
export default CreatePost;
